class Solution {
  int beautifulSubstrings(String s, int k) {
    int count = 0;
    for (int i = 0; i < s.length; i++) {
      int vowels = 0;
      int consonants = 0;
      for (int j = i; j < s.length; j++) {
        if ('aeiou'.contains(s[j])) {
          vowels++;
        } else {
          consonants++;
        }
        if (vowels == consonants && (vowels * consonants) % k == 0) {
          count++;
        }
      }
    }
    return count;
  }
}
